import { Dropdown, Menu, Input } from "antd";
import { DownOutlined } from "@ant-design/icons";

import { BookFilled, BookOutlined } from "@ant-design/icons";



const StudyPlanCard: React.FC = () => {
    const dummyModuleCodes: string[] = [
        "CS1101s", "CS2030", "CS2040", "CS1231", "CS3219"
    ];

    const dummyModuleCodeMenu = (
        <Menu>
          <Menu.Item>CS3203</Menu.Item>
          <Menu.Item>LAK1001</Menu.Item>
          <Menu.Item>GER1000</Menu.Item>
        </Menu>
      );

    const renderModuleCodes = () => dummyModuleCodes.map(moduleCode => {
        return (
            <div style={styles.moduleCode}>
                {moduleCode}
            </div>
        );
    });

    return (
        <div style={styles.container}>
            <div style={styles.header}>
                <BookFilled style={{ ...styles.actionIcon }} />
                    StudyPlan
                    <Dropdown overlay={dummyModuleCodeMenu}>
                    <div style={{ marginRight: 20 }}>
                            NUS
                        <DownOutlined />
                    </div>
                </Dropdown>
            </div>
            <div style={styles.moduleList}>
                {renderModuleCodes()}
            </div>
        </div>

    );
};

const styles = {
    moduleCode: {
        padding: 12,
        backgroundColor: "#2D538C",
        color: "#fff",
        borderRadius: 15,
        boxShadow: "0px 8px 8px rgba(0, 0, 0, 0.25)",
        marginRight: 10
    },
    moduleList: {
        display: "flex",
        flexDirection: "row",
        justifyContent: "flex-start"
    },
    container: {
        padding: 30,
        backgroundColor: "#76CCB7",
        color: "#fff",
        borderRadius: 15,
        boxShadow: "0px 8px 8px rgba(0, 0, 0, 0.25)",
        marginBottom: 15
    },
    header: {
        display: "flex",
        justifyContent: "flex-start",
        fontSize: 20,
        textDecorationLine: "underline",
        fontWeight: "bold",
        alignItems: "center",
        margin: "-5px 0px 10px 0px"
    },
    actionIcon: {
        height: 20,
        marginRight: 10,
        color: "#fff"
    },


};

export default StudyPlanCard;
